import './App.css';

function App() {
  return (
    <div className="App">
      <h1>An electricity bill system</h1>
      <h2>have a bunch of users</h2>
      <p>
      Each user
	- id
	- name
	- Address
	- Bill/usage
	- Payed last month (bool) (check if payed last month)
      </p>
    </div>
  );
}

export default App;
